import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { Container, Row, Col } from 'react-bootstrap';
import RadioPlayer from './RadioPlayer';
import CustomTrackForm from './CustomTrackForm';
import TrackList from './TrackList';
import TrackManager from './TrackManager';
import './App.css';

function App() {
  return (
    <Router>
      <Container>
        <Row>
          <Col>
            <h1>Online Radio Streaming</h1>
            <Switch>
              <Route path="/" exact component={RadioPlayer} />
              <Route path="/upload" component={CustomTrackForm} />
              <Route path="/tracks" component={TrackList} />
              <Route path="/manage" component={TrackManager} />
            </Switch>
          </Col>
        </Row>
      </Container>
    </Router>
  );
}

export default App;
